import React from 'react';
import './navbar.css';



function Navbar() {  
    return (
        <nav className="navbar-custom">
          {}
          <a className="navbar-brand-custom" href="#home">
            <img
              src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRXkI3X3ldqL1YTY2TZhVx-8QeRWlqvCiqtxg&s"
              width="50"
              height="50"
              alt="logo"
            />
            Website Tìm Việc
          </a>
    
          {/* Các mục điều hướng */}
          <div className="navbar-nav-custom">
            <p>Trang chủ</p>
            <p>Việc làm</p>
            <p>Công ty</p>
            <p>Công cụ</p>
            <p>Cẩm nang</p>
            <p>Thông báo</p>
          </div>
    
          {/* Đăng nhập/Đăng xuất */}
          <div className="navbar-auth-custom">
            <p>Đăng nhập</p>
            <p>Đăng xuất</p>
          </div>
        </nav>
      );
}

export default Navbar;
